import React, { Fragment } from "react";
import classes from "./VideoItem.module.css";

const VideoItem = (props) => {
  if (props === null || props.length === 0) {
    return <Fragment />;
  }

  return (
    <Fragment>
      <h2 className={classes.videoName}>{props.source.name}</h2>
      <div>{props.source.description}</div>
      <div>{props.source.standard}</div>
      <div>{props.source.definition}</div>
      <div>{props.source.startTimecode}</div>
      <div>{props.source.endTimecode}</div>
    </Fragment>
  );
};

export default VideoItem;
